use cs3380;

drop table if exists Service;
drop table if exists Luggage;
drop table if exists Guide;
drop table if exists Fly;
drop table if exists CreditCards;
drop table if exists Book;
drop table if exists Attend;
drop table if exists Employee;
drop table if exists Passenger;
drop table if exists Flights;
drop table if exists Runways;
drop table if exists Planes;
drop table if exists Airports;
drop table if exists Airlines;

CREATE TABLE Airlines
(
    airlineName varchar(200) NOT NULL PRIMARY KEY
);

CREATE TABLE Airports
(
    icao varchar(200) NOT NULL PRIMARY KEY,
    type TEXT,
    airportName TEXT NOT NULL,
    continent TEXT NOT NULL,
    country TEXT NOT NULL,
    region TEXT
);

CREATE TABLE Planes
(
    tailNum varchar(200) NOT NULL PRIMARY KEY,
    model TEXT,
    manufacturer TEXT,
    year INTEGER,
    type TEXT,
    category TEXT,
    airline varchar(200),
    FOREIGN KEY (airline) REFERENCES Airlines(airlineName)
);

CREATE TABLE Runways
(
    runNum varchar(200) NOT NULL,
    icao varchar(200) NOT NULL,
    FOREIGN KEY (icao) REFERENCES Airports(icao),
    PRIMARY KEY (icao, runNum)
);

CREATE TABLE Flights
(
    flightNum varchar(200) NOT NULL,
    schedDep datetime2 NOT NULL,
    origin varchar(200) NOT NULL,
    runNumO varchar(200) NOT NULL,
    schedArr datetime2 NOT NULL,
    destination varchar(200) NOT NULL,
    runNumD varchar(200) NOT NULL,
    tailNum varchar(200) NOT NULL,
    FOREIGN KEY (tailNum) REFERENCES Planes(tailNum),
    FOREIGN KEY (origin, runNumO) REFERENCES Runways(icao, runNum),
    FOREIGN KEY (destination, runNumD) REFERENCES Runways(icao, runNum),
    PRIMARY KEY(flightNum, schedDep)
);

CREATE TABLE Passenger
(
    passNum varchar(200) NOT NULL PRIMARY KEY,
    citizen TEXT NOT NULL,
    first TEXT NOT NULL,
    last TEXT NOT NULL,
    dob date NOT NULL,
    email TEXT NOT NULL,
    phoneNum TEXT NOT NULL
);

CREATE TABLE Employee
(
    SIN INTEGER NOT NULL PRIMARY KEY,
    first TEXT NOT NULL,
    last TEXT NOT NULL,
    icao varchar(200),
    airline varchar(200),
    wage NUMERIC NOT NULL,
    FOREIGN KEY (icao) REFERENCES Airports(icao),
    FOREIGN KEY (airline) REFERENCES Airlines(airlineName)
);

CREATE TABLE Attend
(
    flightNum varchar(200) NOT NULL,
    schedDep datetime2 NOT NULL,
    SIN INTEGER NOT NULL,
    FOREIGN KEY (flightNum, schedDep) REFERENCES Flights(flightNum, schedDep),
    FOREIGN KEY (SIN) REFERENCES Employee(SIN),
    PRIMARY KEY (flightNum, schedDep, SIN)
);

CREATE TABLE Book
(
    passNum varchar(200) NOT NULL,
    flightNum varchar(200) NOT NULL,
    schedDep datetime2 NOT NULL,
    airline varchar(200) NOT NULL,
    seatNumber TEXT NOT NULL,
    FOREIGN KEY (passNum) REFERENCES Passenger(passNum),
    FOREIGN KEY (flightNum, schedDep) REFERENCES Flights(flightNum, schedDep),
    FOREIGN KEY (airline) REFERENCES Airlines(airlineName),
    PRIMARY KEY (passNum, flightNum, schedDep)
);

CREATE TABLE CreditCards
(
    passNum varchar(200) NOT NULL,
    ccNum BIGINT NOT NULL,
    ccv INTEGER NOT NULL,
    exp TEXT NOT NULL,
    FOREIGN KEY (passNum) REFERENCES Passenger(passNum),
    PRIMARY KEY (passNum, ccNum)
);

CREATE TABLE Fly
(
    flightNum varchar(200) NOT NULL,
    schedDep datetime2 NOT NULL,
    SIN INTEGER NOT NULL,
    FOREIGN KEY (flightNum, schedDep) REFERENCES Flights(flightNum, schedDep),
    FOREIGN KEY (SIN) REFERENCES Employee(SIN),
    PRIMARY KEY (flightNum, schedDep, SIN)
);

CREATE TABLE Guide
(
    tailNum varchar(200) NOT NULL,
    SIN INTEGER NOT NULL,
    squawk INTEGER NOT NULL,
    FOREIGN KEY (tailNum) REFERENCES Planes(tailNum),
    FOREIGN KEY (SIN) REFERENCES Employee(SIN),
    PRIMARY KEY (tailNum, SIN, squawk)
);

CREATE TABLE Luggage
(
    passNum varchar(200) NOT NULL,
    ID INTEGER NOT NULL,
    type TEXT NOT NULL,
    FOREIGN KEY (passNum) REFERENCES Passenger(passNum),
    PRIMARY KEY (passNum, ID)
);

CREATE TABLE Service
(
    tailNum varchar(200) NOT NULL,
    SIN INTEGER NOT NULL,
    date date NOT NULL,
    FOREIGN KEY (tailNum) REFERENCES Planes(tailNum),
    FOREIGN KEY (SIN) REFERENCES Employee(SIN),
    PRIMARY KEY (tailNum, SIN, date)
);

